What a fantastic way to kick off the holiday season! 🎄🎅🏻

Yesterday we had an amazing time at this year's Come Home for the Holidays event in the @villageoffairport. The magic of Santa’s arrival and the joy on the children's faces were truly heartwarming. 🎁👧🏻👦🏻

We indulged in some scrumptious cookies thanks to @fairportoced and enjoyed the delightful holiday tunes played by the @fairportfiredeparmentband. 🍪🎶 A big thank you to the event sponsors @ide.dealerships. The highlight of the evening was, of course, the lighting of the magnificent tree that illuminated the entire village, with special help from the Fairport Boys Soccer team, who recently won the New York State championship! 🌟🌲⚽🏆

Here are some photos from the event that capture the festive spirit of our community. If you'd like to see the rest, check out our Facebook page!

We hope you enjoyed it as much as we did, and we wish you all a very happy and healthy holiday season! 🎉🎊
